import React from 'react';

function SearchResults(props) {
  return (
    <div>
      <div className="search-results">
        <div className="left">
          <img src="www.superherodb.com\/pictures2\/portraits\/10\/100\/1111.jpg" alt="bat hero" />
        </div>
        <div className="right">
          <h1>Bat woman</h1>
        </div>
      </div>
    </div>
  );
}

export default SearchResults;
